import React from 'react';

export class bodydata extends React.Component {
            render(){
                return(
                <div>
                     <div class="card mb-3">
                        <div class="row g-0">
                             <div class="col-md-4">
                                    <img src="https://media.cntraveller.com/photos/611bf0b8f6bd8f17556db5e4/1:1/w_2000,h_2000,c_limit/gettyimages-1146431497.jpg" class="img-fluid rounded-start" alt=""/>
                             </div>
                             <div class="col-md-8">
                                 <div class="card-body">
                                     <h5 class="card-title">Card title</h5>
                                     <p class="card-text">This is a wider card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
                                </div>
                             </div>
                         </div>
                    </div>
                </div>
        )
    }
}
